e o Sol\nPouca gente sabe que, na noite, o frio é quente e arde e eu acendi \nAté sem luz dá pra te enxergar o lençol\nfazendo \"congo-blue\"\nÉ pena, eu sei, amanhã já vai miar... Se aguente,\nQue lá vem chumbo quente!\n\nComplicada e perfeitinha,\nVocê me apareceu.\nEra tudo que eu queria,\nEstrela da sorte. \nQuando à noite ela surgia,\nMeu bem você cresceu...\nMeu namoro é na folhinha,\nMulher de fases!\n\nComplicada e perfeitinha,\nVocê me apareceu.\nEra tudo que eu queria,\nEstrela da sorte. \nQuando à noite ela surgia,\nMeu bem você cresceu...\nMeu namoro é na folhinha\n\nhttp://youtu.be/_p85FraOPKI','https://i.ytimg.com/vi/_p85FraOPKI/default.jpg','https://i.ytimg.com/vi/_p85FraOPKI/mqdefault.jpg','https://i.ytimg.com/vi/_p85FraOPKI/hqdefault.jpg',NULL,1,'2015-08-06 15:30:50'),(471,8,11695,'o-pao-da-minha-prima-raimundos-felixdumonza-thewallcafe13thirteenfestival-vitor-costa','https://www.youtube.com/watch?v=I4U_iBVAzOc','https://www.youtube.com/embed/I4U_iBVAzOc','I4U_iBVAzOc','O pão da minha prima (Raimundos) - Felixdumonza / #TheWallCafé/13ThirteenFestival','Musica: O pão da minha prima - Raimundos\nCover: Felixdumonza\nData: 28/10/12\n13 Thirteen Festival\n\n#felixdumonza\nVocal/Guitarra - Diego\nGuitarra - Rafael\nBaixo - Vitor\nBateria - Luan\n\n//vamo q vamo//','https://i.ytimg.com/vi/I4U_iBVAzOc/default.jpg','https://i.ytimg.com/vi/I4U_iBVAzOc/mqdefault.jpg','https://i.ytimg.com/vi/I4U_iBVAzOc/hqdefault.jpg',NULL,1,'2015-08-06 20:03:20'),(472,7,11699,'amor-sem-medida-matheus-e-kauan-jamison-guedes-cover-jamison-guedes','https://www.youtube.com/watch?v=zW1jzgLEQOg','https://www.youtube.com/embed/zW1jzgLEQOg','zW1jzgLEQOg','Amor Sem Medida - Matheus e Kauan (Jamison Guedes COVER)','Fala galera, esse é mais um cover meu com a musica \"AMOR SEM MEDIDA\" da dupla \"MATHEUS E KAUAN\"\n\nCurta minha Página no Facebook: https://www.facebook.com/jamisonguedes\n\nSiga-me no Instagram: \n@jamisonguedes\n\nTelefone pra contato:\n(87) 9616-4164\n(87) 9653-4730','