m/coveracademy/coveracademy.github.io/master/prizes/novos-baianos-book.jpg',NULL),(19,7,NULL,1,'Violão Memphis AC40',NULL,'O Violão AC40 é um dos violões clássicos com cordas de aço mais em conta do mercado. Mas não se engane, ele tem uma boa caixa de ressonância e se destaca entre os violões para estudante acústico. O AC40 se destaca entre os violões acústicos para iniciantes, com tarraxas niqueladas e corpo com filete de marfim, seu acabamento é muito bem feito, o que confere um visual bonito para o seu violão. Além de ser indicado para iniciantes que querem um violão bom e barato para começar seu estudo, ele é ideal para quem só quer um violão para reunir os amigos, fazer uma roda e tocar suas músicas favoritas.','https://raw.githubusercontent.com/coveracademy/coveracademy.github.io/master/prizes/memphis-ac40-guitar.jpg',NULL),(20,7,NULL,2,'R$ 55',NULL,NULL,NULL,NULL),(21,7,NULL,3,'R$ 35',NULL,NULL,NULL,NULL),(22,8,NULL,1,'CD \"Cantigas de roda\" autografado + R$ 55',NULL,NULL,'https://raw.githubusercontent.com/coveracademy/coveracademy.github.io/master/prizes/raimundos-cd.jpg',NULL),(23,8,NULL,2,'CD \"Cantigas de roda\" autografado + R$ 35',NULL,NULL,'https://raw.githubusercontent.com/coveracademy/coveracademy.github.io/master/prizes/raimundos-cd.jpg',NULL),(24,8,NULL,3,'CD \"Cantigas de roda\" autografado',NULL,NULL,'https://raw.githubusercontent.com/coveracademy/coveracademy.github.io/master/prizes/raimundos-cd.jpg',NULL),(25,9,NULL,1,'R$ 100',NULL,NULL,NULL,NULL),(26,9,NULL,2,'R$ 55',NULL,NULL,NULL,NULL),(27,9,NULL,3,'R$ 35',NULL,NULL,NULL,NULL);
